def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def holder = groovyUtils.getXmlHolder(messageExchange.responseContent)

def response = holder.getNodeValues("//m:sName")

def matches = 0

def AUDCountry = context.testCase.getPropertyValue("AUDCountry")

for (country in response){
	if (country == AUDCountry){
		matches++
	}
}

if(matches > 0){
	context.testCase.setPropertyValue("AUDResult", "Australian dollars are used in New Zealand")
}else{
	context.testCase.setPropertyValue("AUDResult", "Australian dollars are NOT used in New Zealand")
}
